import React from 'react';
import Landing from './components/Landing';
import Button from '@material-ui/core/Button';

const App: React.FC = () => {
    return (
        <div className="App">
            <Landing />

            <Button variant="contained" color="primary">
                Hello World
            </Button>
        </div>
    );
};

export default App;
